import React from 'react';

function Track({ track: name, artists }) {
  console.log(artists);
  return (
    <div>
      <h3>{name}</h3>
      <div>
        <ul>
          {artists.map((artist) => (
            <li>{artist.name}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Track;
